import styles from "./Modal.module.scss";
const Modal = (props) => {
	return (
		<div>
			<div className={styles.modal}>
				<h1>Sign in</h1>
				<form>
					<label>E-mail</label>
				</form>
			</div>
		</div>
	);
};

export default Modal;
